import React from 'react';

class SelectionPanel extends React.Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <div>
        <ul>
          <li onClick={console.log("square")}>Square</li>
        </ul>
      </div>
    );
  }
}

export default SelectionPanel;
